.<br><br><\/p><p><b>Add ontology:<\/b> Here, you need to provide a unique name for the new ontology. The new ontology will not contain any elements. To add elements create an ontology, choose it from the overview on the left-hand side and open <i>Step 2b: Edit ontology<\/i>.<br><br><\/p><p><b>Delete ontology:<\/b> If you want to delete an existing ontology, just choose it from the list. However, if you delete an ontology which is used by one or multiple templates, these templates and all maps that are based on these templates will be deleted as well. Use this option with care!<\/p>',Nof='<p><b>Description:<\/b> In this step, you will be able to edit the elements of the chosen ontology. There is an overview of nodes and relations of the ontology on the left-hand side ("Elements of this ontology"), whereas a preview of the currently selected element is shown on the right-hand side. The actions that can be done are shown in the bottom area in this step. Please consult the manual for further instructions.<br><br><\/p>',$mf='<p><b>Description:<\/b> Once the ontology and template is defined, you have here the possibility to create concrete instances of an argument map. On the left-hand side, there is an overview of all existing maps (pre-defined as well as user-created ones) sorted by template. On the right-hand side, you can choose if you want to add or delete a map.<br><br><\/p><p><b>Add map:<\/b> To add a new map, you have to choose a template on which the map is based on. Further, each map requires a unique name, which will appear in the map overview after login. Optionally, you can restrict a map to a single user (this of course does only makes sense, if you do not plan to argue collaboratively in this map). To restrict a map to a specific user, choose one from the list. Otherwise leave the field emptry to make it accessible for all users of the system. If you do not want to create pre-defined maps, you can skip this step. Users with role "Standard" (or higher) have
